import { OrderlistWrapper } from "../Styles/Orderlist-Style";


function Orderlist() {
    return(
        <>
            <OrderlistWrapper>
                <div className="wrapper_inner">
                    <div className="page_head">
                        <h2>My <span>Orders</span></h2>
                    </div>
                    <div className="order_section">
                        <div className="left_sec">
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quos cum facilis ab inventore iure mollitia, odio sed repellendus asperiores quo ullam placeat maiores nisi eveniet unde esse recusandae eligendi itaque rerum earum non magni!</p>
                        </div>
                        <div className="right_sec"></div>
                    </div>
                </div>
            </OrderlistWrapper>
        </>
    );
}

export default Orderlist;
